class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        longest = 0
        l = len(s)
        for i in range(l):
            if longest >= l - i:
                break
            str_list = {}
            for j in range(l - i):
                if s[i+j] in str_list:
                    longest = max(j, longest)
                    break
                else:
                    str_list[(s[i+j])] = 1
                if j == l - i - 1:
                    longest = max(j+1, longest)
        return longest


